import React, {useEffect, useState} from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(response => {
                const allThree = response.data.latest;

                setData(allThree)
            })
    }, []);

    return (
        <React.Fragment>
            <div className='corona-numbers'>
                <ul>
                    <li>{data.latest}</li>
                    <li>{data.deaths}</li>
                    <li>{data.recovered}</li>
                </ul>
            </div>
        </React.Fragment>
    );
}

export default App;
